import React from "react";
import FeedbackItem from "./FeedbackItem";
function FeedbackList({feedback}){
    if(feedback.length===0||!feedback){
        return(
            <div>
                Not feedback yet
            </div>
        )
    }
    return(
        <FeedbackItem/>
    )
}
export default FeedbackList;
